        <NewsCard inactiveBtn={props.inactiveBtn} hoverBtn={props.hoverBtn} />
        <NewsCard inactiveBtn={props.inactiveBtn} hoverBtn={props.hoverBtn} />
        <NewsCard inactiveBtn={props.inactiveBtn} hoverBtn={props.hoverBtn} />
      </ul>
    </section>
  )
}

